import './App.css';

function App() {
  return (
    <div className="fromContainer">
      <form>
        <h1>ログインフォーム</h1>
        <hr />
        <div className="uniForm">
          <div className="formField">
            <label>ユーザー名</label>
            <input type="text" placeholder="ユーザー名" name="username" />
          </div>
        </div>
      </form>
    </div>
  );
}

export default App;
